export const handleSubmitProducts = async(e) => {
    e.preventDefault()
    try {

      const obj = {
        name,
        description,
        stock,
        price,
        create_by: 2,
        provider: 2,
      }
      const response = await postProduct(obj)
      close()
    } catch (error) {
        console.log(error)
    }
}
